    .then((response)=>{
       setProjectName(response.data)
        console.log("api",response.data);
    })
    .catch(error=>console.log(error))


}
useEffect(()=>{

   getProjectheadlines();
},[]);


 for(let i=0;i<projectname?.content?.projects.length;i++){

  if(headlines===projectname?.content?.projects[i].projectId){
